function GetHostCommon() {
    if (document.domain == "localhost")
    {
        //alert('localhost');
        return "http://localhost:52439";
    }
    else
    {
        //alert('LIVE')
        return "http://www.geometryholidaycard.com";
    }
}
function LogClickThrough(QueryStringParam)
{
    serviceparameters = '{"QueryStringParam":"' + QueryStringParam + '"}';
    console.log(serviceparameters);
    $.ajax({
        type: "POST",
        url: GetHostCommon() + "/Services/Tools.svc/LogClickThrough",
        data: serviceparameters,
        contentType: "application/json;charset=utf-8",
        dataType: "json",
        processdata: true,
        success: function (result) { console.log(result); console.log("Sucess: Logging Click Through"); },
        error: function (xhr, ajaxOptions, thrownError) {
            console.log("Error: Logging Click Through");

        }
    });
}
