function LogFaceBookShare(QueryStringParam, Image, callback) {
    serviceparameters = '{"QueryStringParam":"' + QueryStringParam + '","Image":"' + Image + '"}';
    //alert(serviceparameters);
    $.ajax({
        type: "POST",
        url: GetHostCommon() + "/Services/Tools.svc/LogFaceBookShare",
        data: serviceparameters,
        contentType: "application/json;charset=utf-8",
        dataType: "json",
        processdata: true,
        success: function (result) {
            callback(result.d);
        },
        error: function (xhr, ajaxOptions, thrownError) {
            console.log("Error: In LogFaceBookShare");
            console.log(xhr);
            console.log(ajaxOptions);
            console.log(thrownError);

        }
    });
}

